  \"Las Vegas Wash Monitoring and Characterization Study: Ecotoxicologic Screening
  Assessment of Selected Contaminants of Potential Concern in Sediment, Whole Fish,
  Bird Eggs, and Water, 2007-2008\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:42:08.560012\",\n\t\"name\": \"las-vegas-wash-monitoring-and-characterization-study-ecotoxicologic-screening-assessm-2007\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Since 1998, the Las Vegas Wash Coordination
  Committee has implemented long-term management strategies for the Las Vegas Wash
  (Wash). A series of projects was undertaken to control erosion, improve water quality,
  and enhance the ecosystem of the Wash. The current report presents, summarizes,
  and interprets data collected in the most recent (third) round of Bioassessment
  sampling conducted from 2007 to 2008. As in the previous two rounds of sampling
  (Intertox 2008, Intertox and B&V 2006), the SNWA and USFWS collected samples of
  sediment, whole fish, and bird eggs from the Wash and its tributaries, as well as
  whole fish and bird eggs from Pahranagat National Wildlife Refuge (PNWR), which
  was used as a regional reference location. The samples were analyzed for residues
  of the selected COPCs. Waterborne COPC concentration data from 2000-2008 were available
  through other monitoring programs conducted by SNWA. COPC concentrations were then
  compared to levels of concern (LOC) identified in previous Bioassessment reports.
  The current report differs from previous ones in that it also presents a comparison
  of data from all three Bioassessment sampling rounds conducted to date.\",\n\t\"license_title\":
